import React from 'react';
import logo from './Yorkshire-Water-logo.jpg';
import './App.css';
import {Button} from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <header >
        <img src={logo} className="App-logo" alt="logo" width="400" height="200"/>
        <p>
          TEST TEST TEST
        </p>
        <Button>
          BUTTTON
        </Button>
      </header>
    </div>
  );
}

export default App;
